import Root from './root';



class App extends Component {

    state={
        name:'abcds'
    }
    fuctn = (code)=>{
        // this.setState({
        //     name:code
        // })
        console.log('from app:  '+code);

    }
    render() {
        return (
            <Router>
                <Switch>
                    <Route exact path="/" component={Myapp}></Route>
                    <Route exact path="/home" component={() => <Root name={fuctn}/>}></Route>
                    <Route exact path='/home/fetch' component={Fetch}></Route>
                </Switch>
            </Router>
        );
    }
}

export default App ;
